import React from 'react';
import SingleQuiz from './SingleQuiz';

function Quizzes({quizzes}) {
    console.log({quizzes})
    quizzes.map(quiz => console.log(quiz))
  return (
    <div>

    {quizzes.map (quiz => <SingleQuiz key = {quiz.id} quiz = {quiz}/>)}
    </div>
  );
}

export default Quizzes;
